        }

       HandleNameInput =(mst)=>
      {
        this.setState({name:mst.target.value});
      }

     HanleSubmitForm = ()=>
     {
          alret(this.state.name);
     }
     
    }
    render() 
    {
        return (<>
            <div className="container p-5">
            <form>
     <div class="form-group">
    <label>Name</label>
    <input type="Name" class="form-control" value={this.state.name} 
     onChange = {this.HandleNameInput.bind(this)}/>
    
     </div>
  
     <button type="submit" class="btn btn-primary">Submit</button>
     
     </form>
            </div>
            
        </>);
    }
}

export default Signup;
